import React, { useEffect, useState } from "react";
import API from "../utils/axios";
import { useNavigate } from "react-router-dom";

const UserPage = () => {
  const [datetime, setDatetime] = useState("");
  const [headquarters, setHeadquarters] = useState("Kathmandu");
  const [address, setAddress] = useState("");
  const [hospital, setHospital] = useState("");
  const [doctor, setDoctor] = useState("");
  const [geoLocation, setGeoLocation] = useState({ lat: null, lon: null });
  const navigate = useNavigate();

  useEffect(() => {
    setDatetime(new Date().toLocaleString());
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (pos) => setGeoLocation({ lat: pos.coords.latitude, lon: pos.coords.longitude }),
        (err) => console.error("Location error:", err)
      );
    }
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await API.post("/userlogs", { headquarters, address, hospital, doctor, geoLocation });
      alert("Data saved successfully!");
      navigate("/");
    } catch (err) {
      alert(err.response?.data?.message || "Error saving data");
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/");
  };

  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center p-8">
      {/* Header */}
      <div className="flex justify-between items-center w-full max-w-2xl mb-6">
        <h1 className="text-3xl font-bold text-blue-700">User Page</h1>
        <button
          onClick={handleLogout}
          className="bg-red-500 hover:bg-red-600 text-white px-4 py-2 rounded"
        >
          Logout
        </button>
      </div>

      {/* Form */}
      <form onSubmit={handleSubmit} className="bg-white p-6 rounded shadow-md w-full max-w-2xl space-y-4">
        <div>
          <label className="block font-semibold mb-1">Date & Time</label>
          <input type="text" value={datetime} disabled className="border p-2 rounded w-full bg-gray-100" />
        </div>

        <div>
          <label className="block font-semibold mb-1">Headquarters</label>
          <select value={headquarters} onChange={(e) => setHeadquarters(e.target.value)} className="border p-2 rounded w-full">
            {["Kathmandu","Biratnagar","Janakpur","Lahan","Birgunj","Pokhara","Butwal","Narayanghat"].map(hq => (
              <option key={hq} value={hq}>{hq}</option>
            ))}
          </select>
        </div>

        <div>
          <label className="block font-semibold mb-1">Address (Location)</label>
          <input type="text" value={address} onChange={(e) => setAddress(e.target.value)} placeholder="Enter address" required className="border p-2 rounded w-full" />
        </div>

        <div>
          <label className="block font-semibold mb-1">Hospital / Pharmacy</label>
          <input type="text" value={hospital} onChange={(e) => setHospital(e.target.value)} placeholder="Enter hospital/pharmacy" required className="border p-2 rounded w-full" />
        </div>

        <div>
          <label className="block font-semibold mb-1">Doctor's Name</label>
          <input type="text" value={doctor} onChange={(e) => setDoctor(e.target.value)} placeholder="Enter doctor's name" required className="border p-2 rounded w-full" />
        </div>

        <button type="submit" className="bg-blue-500 hover:bg-blue-600 text-white px-6 py-2 rounded w-full">
          Submit
        </button>
      </form>
    </div>
  );
};

export default UserPage;
